package programming.strings;

import java.util.HashMap;

/*
Given two strings s and t, return true if t is an anagram of s, and false otherwise.
An Anagram is a word or phrase formed by rearranging the letters of a different word or phrase, typically using all the original letters exactly once.
Example 1:

Input: s = "anagram", t = "nagaram"
Output: true
Example 2:

Input: s = "rat", t = "car"
Output: false
 */
public class ValidAnagram {
    public static void main(String[] args) {
        String s = "";
        String t = "";
        HashMap<Character,Integer> hm1 = new HashMap<>();
        HashMap<Character,Integer> hm2 = new HashMap<>();
        for(int i=0; i<s.length(); i++){
            if(hm1.containsKey(s.charAt(i))){
                int freq = hm1.get(s.charAt(i));
                freq++;
                hm1.replace(s.charAt(i),freq);
            }else{
                hm1.put(s.charAt(i),1);
            }
            if(hm2.containsKey(t.charAt(i))){
                int freq = hm2.get(t.charAt(i));
                freq++;
                hm2.replace(t.charAt(i),freq);
            }else{
                hm2.put(t.charAt(i),1);
            }
        }

        //Checking
        System.out.println(checkAnagram(hm1,hm2));

    }

    private static boolean checkAnagram(HashMap<Character, Integer> hm1, HashMap<Character, Integer> hm2) {
        for(Character key : hm1.keySet()){
            if(!hm2.containsKey(key)){
                return false;
            }
            if(!hm2.get(key).equals(hm1.get(key))){
                return false;
            }
        }
        return true;
    }
}


